import React from 'react'; 
import docpic from './service.png'

class Test extends React.Component{

    constructor(props) {
        super(props);

        this.state = {
          FileURL: '',
        };

        this.handleUploadFile = this.handleUploadFile.bind(this);
      }

      handleUploadFile(ev) {
        ev.preventDefault();

        const data = new FormData();
        data.append('file', this.uploadInput.files[0]);
        data.append('filename', this.fileName.value);

        fetch('http://localhost:8080/predict', {
          method: 'POST',
          body: data,
        }).then((response) => {
          response.json().then((body) => {
            this.setState({ FileURL: `http://localhost:8080/${body.file}` });
          });
        });
      }

     render(){ return (

        <section id="test" className="test">
            <h2 className="test-h">Our service</h2>
        <div className="container-t">
          <div className="test">
                <h2 >Check Whether you have<br/> Parkinson's Disease or not</h2>
          </div>
          <div class="row justify-content-between align-items-center">

              <div id="drop-area">
                <form onSubmit={this.handleUploadFile} className='my-form' encType="multipart/form-data">  
                <p>Upload Your audio in .wav format here</p>
                <input ref={(ref)=> {this.uploadInput=ref;}} type="file" name="file" id="fileElem" Content-Type= "multipart/form-data"/>  
                <input className="button" htmlFor="fileElem" type = "submit" value="Select File"/> 
                <button>Upload</button>
                </form>  
              </div>
          </div>
        </div>
        <div className="doctor">
        <img className="doc-pic"  src={docpic} alt="doc" />
        </div>
        <div className="result">
            <h1 id="prediction">0.00%</h1>
            <br/>
            <p>Probability of Patient having Parkinson's</p>
        </div>

        <div className="how">
        <h1 className="cal">How the result is calculated?</h1>
        <br/>

        <p> After you submit your voice file. The system then runs some algorithms to extract important information from the audio file.
             Further the information is send to the extensively tested machine learning model and then model predicts whether the user has parkinson's diesease or not</p>
        </div>
        </section>


    );
  }
}

  export default Test;
